backup_values:
Участники роли имеют привилегии на выполнение простых задач администрирования пользователей:
- изменение паролей пользователей;
- управление сертификатами пользователей;
- управление User Principals;
- изменение атрибутов пользователей;
- изменение состава участников групп пользователей.

